#!/bin/sh
set -x
export RAPID_ADMIN_HOME=/opt/${user.id}
HOSTNAME=${p:HOST}
environment=${environment.name}

function installAdmin()
{
	option=$1
	service=$2
	logPath=$3
	echo "****************** BEGIN ${option} installation ....."
	raAdminTool=/tmp/ra-admin-unpack
	tempLocation=/tmp/ra-admin-unpack/_ra_installation
	echo "Creating temp Location and copying artifacts from `pwd` to ${raAdminTool}"
	mkdir -p ${raAdminTool}
	mkdir -p ${tempLocation}
	unzip ra.platform-${p:RA_VERSION}.zip -d ${tempLocation}
	cp *.properties ${tempLocation}
	configurationFile=${tempLocation}/configuration.properties
	ZIP_NAME=ra.platform-${p:RA_VERSION}.zip
	echo "ZIP_NAME = $ZIP_NAME"
	RA_VERSION=`echo $ZIP_NAME | rev | cut -d "." -f2- | cut -d "-" -f1 | rev`
	echo "VERSION = $RA_VERSION"
	chmod -R 755 ${tempLocation}
	cd ${tempLocation}
	sed -i "/platform.environment/s/=.*$/=${environment}/" configuration.properties
