#!/bin/bash
export INSTALL_FILE_NAME=install_ucd3_agent
echo "Debug: Check running ucd agent in ps"
ps -ef | grep "/opt/udeployha/agent"
echo "Debug: Check running ucd3 agent in ps"
ps -ef | grep "/opt/ucd3/agent"
[ ! -f "/var/tmp/$INSTALL_FILE_NAME.tar" ] && echo "Agent installation tar missing" && exit 1
[ -f "/opt/ucd3/java/jre/bin/java" ] && echo "Seems ucd3 is already installed, listing files in /opt/ucd3, exiting" && find /opt/ucd3 -print && exit 1
tar -cf /opt/udeployha_bkp.tar /opt/udeployha || { echo 'backup for agent ucd1 failed' ; exit 1; }
# not required, tar will be brought by uDeploy 
# cp /net/stealth/export1/home1.localhost/sw/Linux/uDeploy_Agent_RHEL_7.0.3.2_20200715_v17.tar /var/tmp || { echo 'copy tar failed' ; exit 1; }
# should exist or installaed automatically 
# cp /net/stealth/export1/home1.localhost/sw/Linux/uDeploy_linux_linux_amd64_em64t_ibm-java-jre-8.0-6.10-linux-x86_64.tgz /tmp/ || { echo 'copy java failed' ; exit 1; }
cd /var/tmp
tar -xvf /var/tmp/$INSTALL_FILE_NAME.tar || { echo 'untar agent failed' ; exit 1; }
cd /var/tmp/ibm-ucd-agent-install || { echo 'cd to /var/tmp/ibm-ucd-agent-install failed' ; exit 1; }
./install-agent-linux.sh prod3 | tee /var/tmp/ucd3_agent_install.log

